def findMinDifference(timePoints: 'List[str]'):
    minutes = []
    timePoints.sort()
    for tp1 in range(len(timePoints)-1):
        #timePoints[tp1] = '23:60' if timePoints[tp1] == '00:00' else timePoints[tp1]
        for tp2 in range(tp1+1, len(timePoints)):
            #timePoints[tp2] = '23:60' if timePoints[tp2] == '00:00' else timePoints[tp2]
            hour1= int(timePoints[tp1].split(":")[0])
            hour2 = int(timePoints[tp2].split(":")[0])
            min1 = int(timePoints[tp1].split(":")[1])
            min2 = int(timePoints[tp2].split(":")[1])
            time1 = hour1*60+ min1
            time2 = hour2*60 + min2
            diff = abs(time2 - time1)
            if diff*(1440-diff)== 0:
                return 0
            minutes.append(1440-diff)
            minutes.append(diff)

    return min(minutes)

